import GameDetails from "./components/GameDetails";
import Header from "./components/Header";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Header userName="visitor" />
      <Routes>
        <Route path="/" element={<GameList />} />
        <Route path="/games/:id" element={<GameDetails />} />
      </Routes>
    </div>
  );
}

export default App;
